import './App.css';
import Navbar from './Component/Navbar';
import { Route, Router, Routes } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
        <Route path='/' element={<Navbar/>} />
        </Routes>
      <h1>E-Dashboard </h1>
      </Router>
    </div>
  );
}

export default App;
